list.TUTORIAL_NEXT_DESCRIPTION_NEW:
Αφού εκτελέσετε τη ρύθμιση `{{prefix}}setup`, οι χρήστες θα μπορούν να υποβάλουν προτάσεις και το bot θα λειτουργήσει. Αν ψάχνετε για πιο σύνθετες επιλογές διαμόρφωσης, όπως προσαρμοσμένες αντιδράσεις τροφοδοσίας προτάσεων και αυτόματος καθαρισμός εντολών προτάσεων, δοκιμάστε το `{{prefix}}config`

Εάν έχετε κάποιο πρόβλημα, ή απλά θέλετε να μάθετε παραπάνω για το bot, μπείτε στον __Διακομιστή Υποστήριξης του Suggester__: {{invite}}
Αυτή η ενσωμάτωση μπορεί να εμφανιστεί ανά πάσα στιγμή χρησιμοποιώντας την εντολή `{{prefix}}tutorial`.

